import React from "react";
import frontend_technologiesImage from '../images/frontend_technologies.png'
import Card from "../components/Subscribe_card";

const Main = () => {
    return (
        <section id="main-section">
            <div className="main">
                <img src={frontend_technologiesImage} alt="technoligies" className="img" />
                <Card />
            </div>
        </section>


    );
}
export default Main;
